INSERT INTO "public"."gaode_residential_region" VALUES ('B023B01F7C', '330100', '120.115563,30.316002;120.113702,30.315283;120.113447,30.31591;120.113976,30.316122;120.114719,30.316385;120.114653,30.316612;120.114629,30.316672;120.115264,30.316897;120.115564,30.316057;120.115563,30.316002', '化纤新村', '杭州市拱墅区莫干山路760', '杭州市', '', '14179.002053', '120.114575,30.316045', '商务住宅;住宅区;住宅小区', '', 'None', '32000平方米', '19979', '化纤新村属于单位房改房,总幢数23幢,1-9幢约1975年,9-23幢约1983年,分南北两区,南区是老房,北区是新的一批。化纤新村建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B01F9C', '330100', '120.087304,30.325315;120.087575,30.32536;120.08759,30.325412;120.087463,30.325677;120.087634,30.325734;120.08784,30.325466;120.088263,30.324861;120.088642,30.324264;120.088705,30.324144;120.088662,30.324116;120.087515,30.323976;120.087304,30.325315', '金帝花园', '杭州市西湖区灯彩街69号', '杭州市', '', '12122.645007', '120.087879,30.324687', '商务住宅;住宅区;别墅', '', 'None', '', '45707', '成都金地房屋开发公司投资1.5亿人民币开发的金地花园,位于成都市菊乐大道少陵东路1号,小区占地78亩,总建筑面积10万平方米,容积率1.4,绿化率达48%。金地花园以创建跨世纪品质的生态居住社区为目的,在规划设计思想上,立足于跨世纪的经济发展状况和生活居住水平的需求,在秉承中国传统建筑精髓的同时,积极宏扬二十一世纪生态居家理念', '', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B01F9F', '330100', '120.108101,30.278087;120.108877,30.278121;120.109057,30.277425;120.109452,30.276621;120.10926,30.276584;120.108803,30.276574;120.108804,30.276487;120.108213,30.276447;120.108231,30.276202;120.107549,30.276184;120.107543,30.276523;120.106839,30.276503;120.106764,30.278013;120.106745,30.278423;120.106731,30.278601;120.106944,30.27861;120.108077,30.278647;120.108101,30.278087', '金都新城', '杭州市西湖区文三西路326号', '杭州市', '', '42132.286675', '120.107883,30.277401', '商务住宅;住宅区;住宅小区', '0.55', '2.65', '120000平方米', '34664', '金都新城位于文三西路236号。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。  周边配套:公 交:有9路,804路,809路。学 校:学军中学,幼儿园。医 院:浙江第二中医院。小区内设施完善有中餐厅,超市,美容美发,娱乐中心,洗衣房,棋牌室,阅览室,多功能宴会厅,餐厅。', '2000-05-01', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B01FB6', '330100', '120.103388,30.276023;120.1011,30.275989;120.100925,30.27607;120.100852,30.276141;120.100809,30.27625;120.100592,30.277406;120.10227,30.277523;120.103187,30.277567;120.103388,30.276023', '康乐新村', '杭州市西湖区文三西路472号', '杭州市', '', '34760.210557', '120.102028,30.276757', '商务住宅;住宅区;住宅小区', '', 'None', '', '27651', '康乐新村在文三西路上,城西的次新小区,算是较早的商品房,其中多层22幢,一期20幢,古墩路与文三西路交叉口的那幢房子(22幢)是2000年新造的,东南西北朝向。1幢、2幢沿文三西路,13幢、16幢、19幢的西边套沿古墩路,1997年和2000年建筑。周边交通:公交:6/K6 43/K43 46 K64 K208(夜间线) K274 316/K316 K535 X1 K218(夜间线) K75 K607 8/K8总站。', '', '0.3-1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B02036', '330100', '120.109465,30.27418;120.109586,30.274172;120.10982,30.27348;120.110068,30.272651;120.108095,30.272204;120.107247,30.27202;120.107145,30.272286;120.108008,30.272489;120.107801,30.273164;120.107636,30.27372;120.108428,30.273864;120.108357,30.274115;120.109006,30.274273;120.109094,30.274291;120.109354,30.274204;120.109465,30.27418', '秋水苑', '杭州市西湖区莲花街56号', '杭州市', '', '33279.074127', '120.108769,30.273173', '商务住宅;住宅区;住宅小区', '', '1.8', '', '36419', '◆杭州市市中心规模最大的住宅区之一,总建筑面积35万平方米,建成后拥有60幢多层、小高层、高层,共计2000余户家庭居住单位。◆以国家最具专业指导标准的"国家康居示范工程"的各项技术指标为蓝本,由高品质技术构成的现代化社区。◆首家采用国际招投标方式设计的住宅区,规划按"社区入口--主题公园--栋间庭院--门厅--住户门厅"的空间舒适度展开设计思考,使每一项户外空间内容的设计从本质上提升园区的空间舒适度。◆60幢5~18层不等的建筑群落矗立于天目山路旁,几何形板块结构,大面积的玻璃和精致的金属件构造出醒目的现代精神,时尚、前卫而积极。◆依据美国佛罗里达社区的生活模式,以绮丽的异域景观特色,构建"闲适、新颖、健康"社区主题,创造主题公园、特色景观与功能性景观相结合的三度景观层次。◆以远山、森林和50米宽的水岸绿化景观围绕的社区,与远山相望,与近水为邻。◆以中心会馆、泳池、网球场、篮球场以及合理服务半径设计的组团泛会所构建的社区生活配套。合理的人车分流布局。◆全面采用太阳能的生态型住宅园区。◆以电信FTTB+LAN宽带网络技术为依托的全面智能化住宅区。', '2000-12-18', '1.1元/月/平方米');
