INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0209E', '330100', '120.112459,30.290123;120.111292,30.290078;120.111261,30.29047;120.111205,30.291149;120.111988,30.291185;120.112361,30.291185;120.112459,30.290123', '文苑小区', '杭州市西湖区西湖西湖区文苑路29号', '杭州市', '0103000020E6100000010000000700000004C93B8732075E4042D13C80454A3E409D137B681F075E40024A438D424A3E407F1475E61E075E401878EE3D5C4A3E40B58993FB1D075E405B43A9BD884A3E40D862B7CF2A075E40F415A4198B4A3E40231631EC30075E40F415A4198B4A3E4004C93B8732075E4042D13C80454A3E40', '11365.059898', '120.111829,30.290636', '商务住宅;住宅区;住宅小区', '', '2.4', '', '28336', '文苑小区位于西斗门路,北面是物华小区,西面是湖畔莲花港,东面是桃源春居,小区交通不是很便利,门口只有一路公交车,小区不大,以公务人员居住为主,所以小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B020A7', '330100', '120.168871,30.233922;120.167955,30.234092;120.167913,30.234114;120.167901,30.234146;120.167933,30.234588;120.167975,30.234969;120.169061,30.23483;120.168871,30.233922', '吴山新村', '杭州市上城区大马弄', '杭州市', '0103000020E610000001000000080000008A8F4FC8CE0A5E409ED0EB4FE23B3E40C80C54C6BF0A5E4057410C74ED3B3E40B0E42A16BF0A5E40278925E5EE3B3E40CEFDD5E3BE0A5E403D7D04FEF03B3E40D4BA0D6ABF0A5E40B7088CF50D3C3E40EBE2361AC00A5E40E692AAED263C3E40DC813AE5D10A5E40A31EA2D11D3C3E408A8F4FC8CE0A5E409ED0EB4FE23B3E40', '8532.88357', '120.168456,30.234463', '商务住宅;住宅区;住宅小区', '', '1.4', '23000平方米', '', '小区交通便利 配套完善', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B02117', '330100', '120.097719,30.278769;120.097228,30.278707;120.096489,30.281191;120.097893,30.281342;120.099436,30.281469;120.099566,30.281415;120.099698,30.280672;120.100036,30.278979;120.098562,30.278866;120.097719,30.278769', '颐景园', '杭州市西湖区古墩路383号', '杭州市', '', '67853.580065', '120.098315,30.280118', '商务住宅;住宅区;住宅小区', '', 'None', '', '37684', '颐景园位于文二西路与古墩路交叉口。依据苏州园林式设计,取颐和园之设计灵感,西湖之美景,两者完美融合与一体,精心打造之城西唯一的园林式造景小区。小区内环境古朴典雅,小道蜿蜒曲折、凉亭点缀其间,粉墙黛瓦,端庄素雅,绿化颇费思量,四季能享受到淡淡花香。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0212E', '330100', '120.105407,30.275103;120.105347,30.274879;120.104533,30.274785;120.104381,30.274751;120.103864,30.274738;120.103804,30.274765;120.103756,30.274793;120.103671,30.274843;120.103573,30.274973;120.102852,30.274894;120.1028,30.275005;120.102782,30.275123;120.103043,30.275135;120.103074,30.275601;120.103076,30.275803;120.104933,30.275881;120.105629,30.275903;120.105407,30.275103', '月桂花园', '杭州市西湖区文三西路251号', '杭州市', '', '22965.093545', '120.104279,30.275344', '商务住宅;住宅区;住宅小区', '', 'None', '', '36371', '绿城·杭州月桂花园是桂花园系列房产的第四个项目,位于杭州城西文苑路南,东临炮台路,西临古墩路,与丹桂公寓毗邻,为城西靠近市中心的一个别墅 区。小区总占地45亩,园区绿化率65%,容积率0.42。园内拥有双联别墅和独立别墅共28幢。沿文三街建有商铺、写字楼以及跃层式公寓,使小区更富有生机,满足不同人士的选择。在户型设计上采用美式别墅的户型,并汲取桂花园系列别墅园区的开发经验,使别墅的外观更加美观,户型更趋合理。', '', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B02174', '330100', '120.099394,30.290871;120.100022,30.290865;120.100025,30.290612;120.100017,30.290309;120.099062,30.290363;120.099068,30.290623;120.098781,30.290747;120.098709,30.290835;120.098591,30.290852;120.09831,30.290844;120.098073,30.290852;120.098083,30.291158;120.098185,30.291149;120.098179,30.291576;120.098184,30.292329;120.098192,30.292778;120.099365,30.29271;120.099619,30.292687;120.099566,30.29198;120.09948,30.291292;120.099432,30.291287;120.099394,30.290871', '政新花园', '杭州市西湖区古墩路582号', '杭州市', '', '28395.195996', '120.098958,30.291598', '商务住宅;住宅区;住宅小区', '', 'None', '', '46861', '政新花园是2000年新建的住宅小区,系万象物业公司所属的服务网点之一。建筑面积为3300平方米,共21幢442套户型各异的住房。内设办公、经营用房及其它相应的配套设施。小区结构布局合理,建筑格调清新,园林秀美,管理规范有序。物管服务涉及安全、消防、卫生、绿化、共建、维修、车辆管理和宣传等项目内容。设有专人接待住户来人来电、解答咨询及信息反馈工作。同时还可根据业主需求提供部分室内维修和家政等方面的有偿服务。被西湖区物价局及行业主管部门评定为甲级小区。物管费仍按乙级标准(即平方米0.50元)、机动车泊位每车每月100元收取。是目前市政府所属住宅小区中整体环境为优雅的住宅小区之一。', '', '0.5元/月/平方米');
