INSERT INTO "public"."gaode_residential_region" VALUES ('B023B02FXX', '330100', '120.178659,30.273621;120.178708,30.273611;120.178775,30.273616;120.17919,30.273706;120.179257,30.273718;120.179303,30.27371;120.179715,30.271769;120.179142,30.271643;120.178872,30.271587;120.178814,30.271798;120.178614,30.27235;120.178414,30.272855;120.178248,30.273556;120.178659,30.273621', '利兹城市公寓', '杭州市下城区建国北路609-631号', '杭州市', '', '18043.350038', '120.179012,30.272692', '商务住宅;住宅区;住宅小区', '90个', 'None', '53000平方米', '33127', '共220套房,位于建国北路上,交通便利。', '', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B02H8E', '330100', '120.179158,30.263315;120.179167,30.263257;120.179175,30.263158;120.178654,30.263177;120.178648,30.263965;120.178624,30.264463;120.179004,30.264478;120.179021,30.264374;120.179101,30.263883;120.179154,30.263346;120.179158,30.263315', '天安假日公寓', '杭州市下城区凤起路139号(近建国路)', '杭州市', '', '5384.309964', '120.178876,30.263786', '商务住宅;住宅区;住宅小区', '', '6.6', '', '39628', '天安假日公寓位于市中心居住地段之一,北临的凤起路是一条市区东西主干线,且少有堵车之虞,虽然地处市中心,但无喧杂之感,居住生活少有干扰,且可坐享东河之丽景。北靠凤起路,东临东河,南接沿东河住宅区,西接直大方伯路,无市区一般住宅之拥挤感。与庆春路的商业街的氛围相比,凤起路两侧则以住宅建筑为街景风格,是旺中带静的居家好地方。', '1999-05-01', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B02PB4', '330100', '120.105902,30.273511;120.105252,30.273397;120.105235,30.273791;120.105493,30.274933;120.10612,30.274831;120.10625,30.275065;120.106347,30.275153;120.106465,30.275233;120.106637,30.275324;120.106971,30.275412;120.106935,30.27549;120.107414,30.275633;120.107555,30.275297;120.107733,30.274753;120.107879,30.274284;120.108006,30.273851;120.105902,30.273511', '沁雅花园', '杭州市西湖区文三西路111号', '杭州市', '', '35465.400288', '120.106611,30.274393', '商务住宅;住宅区;住宅小区', '0.5', '1.52', '100000平方米', '29696', '沁雅花园位于文三西路与竟舟路交叉口,占地约40亩,建筑面积约41653平米,规划建筑10栋,总户数为333户。  沁雅花园交通便捷,环境优雅,人文气息浓厚,距楚水实验学校约100米。小区建筑品质高尚,采用高档外墙面砖及高档涂料饰面,彩色铝合金断桥隔热门窗,新古典主义的建筑风格,充分彰显了小区的精致 、完美。小区南侧超大沿河景观全长460多米,总面积超过1万平米,拥有主题雕塑、对景长廊、健身园以及多处观景平台。100米间距,超开阔的视野,推窗即景,让您坐在家中即能饱享高王河畔得天独厚的景观资源,是一个典型的紧邻学府的高尚景观住宅社区。', '2000-01-31', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0307E', '330100', '120.106702,30.288057;120.106956,30.287026;120.106246,30.28701;120.105924,30.287001;120.105877,30.287304;120.105692,30.287977;120.105427,30.287942;120.105299,30.288383;120.105559,30.28844;120.1055,30.288757;120.106475,30.288928;120.106702,30.288057', '天湖公寓(文一西路)', '杭州市西湖区南天路与文一西路交叉口东北150米', '杭州市', '', '18222.124124', '120.106178,30.287947', '商务住宅;住宅区;住宅小区', '', 'None', '', '29487', '天湖公寓位于文华路与丰潭路交叉口。天湖公寓是由雅景阁、冠天阁、彩天阁等12幢7层高的公寓围合而成的小区,每幢公寓内都有电梯,一梯四户,每套房子的户型都是全明的。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.8元/月/平方米');
