INSERT INTO "public"."gaode_residential_region" VALUES ('B023B05SQF', '330100', '120.203277,30.234035;120.203974,30.233512;120.204046,30.233414;120.204111,30.233331;120.204143,30.233187;120.204176,30.232415;120.203565,30.232365;120.203286,30.232343;120.203002,30.232316;120.20252,30.232639;120.201273,30.23339;120.201782,30.233928;120.202006,30.233845;120.202288,30.233756;120.202623,30.233748;120.202796,30.233782;120.203016,30.233869;120.20315,30.233943;120.203277,30.234035', '滨江新苑', '杭州市上城区近江东路59号', '杭州市', '', '28651.894214', '120.202942,30.233169', '商务住宅;住宅区;住宅小区', '', 'None', '', '42426', '物业类型是多层住宅,小区开盘时间在1998年,就在钱塘江边上,属于钱江新城的房子该地块环境优美,交通便利。目前滨江大道正在铺设,杭州市政府要将其建设成为杭州市的外滩。以新的市政府大楼、大剧院、体育中心以及一批高标准办公、金融、商业、居住建筑为主体的新城已经全面启动。随着这些项目的陆续建成,市中心将向钱塘江畔偏移,一个杭州的“钱塘江时代”即将到来。', '', '0.38元/月/平方米');
