INSERT INTO "public"."gaode_residential_region" VALUES ('B023B05TEE', '330100', '120.161459,30.170618;120.15982,30.169923;120.159643,30.170273;120.159737,30.170412;120.159615,30.170649;120.163652,30.172026;120.163821,30.171577;120.163042,30.171259;120.161459,30.170618', '时代·长岛之春', '杭州市滨江区高教园区明志路99号', '杭州市', '', '23849.152924', '120.161573,30.170988', '商务住宅;住宅区;住宅小区', '', 'None', '', '31650', '长岛之春由浙江时代长岛之春房地产开发有限公司开发,位于滨江高教园区,其主要优点为:一、地段较好,二、性价比高,三、综合配套齐全且娱乐配套一应俱全。  长岛之春在园区内部景观的塑造上,充分借鉴东方传统园林的造景手法,利用建筑排布的空间层次感,缩放有致,移步易景,营造出独具一格的庭院景观。长岛之春沿街设置为一条线型的复合商业街,强调街区、店面、广场和景观等空间的有机性和整体性,并通过个性化专门的商业形态来造就具有文化特色的商业环境。', '', '0.8元/月/平方米');
