INSERT INTO "public"."gaode_residential_region" VALUES ('B023B05VJG', '330100', '120.135209,30.289686;120.135879,30.289679;120.135879,30.289897;120.135835,30.290755;120.135139,30.290737;120.135209,30.289686', '德雅花园', '杭州市西湖区教工路280号', '杭州市', '0103000020E61000000100000006000000FE47A643A7085E40EB1B98DC284A3E40A54DD53DB2085E4086562767284A3E40A54DD53DB2085E40613596B0364A3E40BDA94885B1085E40032670EB6E4A3E40815A0C1EA6085E40B6BC72BD6D4A3E40FE47A643A7085E40EB1B98DC284A3E40', '6657.316517', '120.135519,30.290217', '商务住宅;住宅区;住宅小区', '', 'None', '', '35493', '合在众多高等院校中的新德雅公寓,位于文一路以北,教工路以东,是一栋24层的高尚商住楼。它背抵浙江工程学院,一面正对着其操场,高校儒雅的气息和清新的空气扑面而来。此外,杭州师范学院、杭州商学院、浙江电子工学院等皆咫尺之遥,让您行可观校园风情,停可闻朗朗书声。公寓与翠苑小区比邻,公建配套极为出色,各类娱乐、餐饮场所环布四周,11路、58路、19路、333路、816路、假日4线等多路公交穿梭其中,6000平方米的墅园公园、大型超市、农贸市场、体育场馆皆在步行范围内,入住后可充分享受便利。杭钢集团与国大集团共同组建的浙江国际嘉业房地产开发有限公司接手新德雅公寓后,以大气魄、大手笔投入二次开发,并赋予了其新的内涵。如今的新德雅公寓已进入内外部装饰阶段,它质量可靠、结构合理、户型科学。理想与现实,在这里找到了最佳的契合点。br文一街学区房', '', '0.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B05WA0', '330100', '120.162216,30.289225;120.163569,30.289569;120.163872,30.289118;120.163896,30.289053;120.163745,30.288993;120.163592,30.288931;120.162976,30.288757;120.162692,30.28873;120.162612,30.288822;120.162549,30.288889;120.162457,30.288952;120.162346,30.288965;120.162282,30.288988;120.162216,30.289225', '东方豪园', '杭州市下城区潮王路45号', '杭州市', '', '7717.560702', '120.163078,30.289132', '商务住宅;住宅区;住宅小区', '', '2.2', '35420平方米', '26908', '东方豪园坐落杭州市中心的上塘路与潮王路交界处,地点闹中取静,其独特的建筑设计,代表着一种居住新概念,为住户创造二十一世纪的生活品位。总建筑面积约39,884平方米,分别由一幢27层及一幢23层公寓组合而成,并附设2,200平方米的商场及住客会所,提供312户住户日常所需及消遣。', '', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B05WDC', '330100', '120.100995,30.285812;120.100968,30.286028;120.100974,30.286071;120.100983,30.286111;120.100975,30.286442;120.10206,30.286489;120.102778,30.286484;120.103182,30.286507;120.10328,30.286508;120.10344,30.286366;120.103569,30.285876;120.103715,30.285377;120.10314,30.285366;120.102575,30.28535;120.102596,30.284765;120.102628,30.284234;120.102508,30.284232;120.102029,30.284221;120.101617,30.284215;120.101211,30.284212;120.101189,30.284263;120.10117,30.284358;120.101165,30.284475;120.101142,30.284644;120.10112,30.284783;120.101091,30.284969;120.101052,30.285266;120.101022,30.285575;120.100995,30.285812', '东海名仕家园', '杭州市西湖区文新街道文一西路219号', '杭州市', '', '41379.456922', '120.102125,30.285498', '商务住宅;住宅区;住宅小区', '', '1.5', '', '38792', '东海.名仕家园位于文华路竟舟路口,东与求是小学竟舟校区相依,南与紫桂花园乡邻,交通流畅、环境优雅,是一座高尚居住园区。名仕家园总占地76亩,总建筑面积81693平方米,建有格调高雅的多层公寓20幢、景观电梯房3幢,共505户。车位200多个。园区容积率仅1.5,并享有搞绿化率。高标准的间距规划,使整个园区的居住空间享有充足的阳光和开阔的视野。名仕家园优越的规划、现代风格的建筑,精致的配套,构成一个独具人文格调的高品位园区,成为城西独树一帜的新一代房产代表。 户型设计呈现以下几个特色: 开放式厨房: 厨房采用开放式设计,与餐厅处在同一个空间,方便实用,吻合现代都市人的生活习惯。 高格调客厅:名仕家园的客厅大开间,都带阳台,这种设计不但有助于提升整个家庭的格调,更为日常生活提供较大便利,收晾衣服不必穿过卧室。使家庭每个人的私密空间免受打搅。 多阳台设计:许多单元内设计有两个外凸式阳台,有些甚至达到三个,不但使室内空间敞亮,更引入园区宜人景色,这种设计符合现代人享受更多自然光,更多空间的居家品位。 面积低窗:名士家园的各个空间均有着大面积大面积的低窗台或落地式景观窗,明厨明卫明厅,空间通透,景观漂亮,与大自然更接近,适合现代化居家生活。 求是小学学区房', '2001-09-30', '1-1.2元/月/平方米');
