INSERT INTO "public"."gaode_residential_region" VALUES ('B023B061M6', '330100', '120.192824,30.295596;120.192928,30.294971;120.192552,30.29492;120.191781,30.294867;120.191685,30.294883;120.191534,30.29511;120.191209,30.295529;120.190961,30.295854;120.190888,30.295957;120.191415,30.296229;120.191572,30.296267;120.192719,30.296384;120.192824,30.295596', '广利佳苑', '杭州市江干区池塘庙路25号', '杭州市', '', '20017.368889', '120.192036,30.295633', '商务住宅;住宅区;住宅小区', '81个', '1.61', '31325.7平方米', '31807', '广利佳苑是广利房产继广利.普金家园后推出的又一个浪漫主义人文的楼盘。它位于成熟的三里亭中心区位,由多层和小高层组成,建筑风格现代简洁,临近艮山住宅区和文晖路等多条交通主干道,交通极为方便,5路、40路和805路公交车终点站就在小区的对面。周边生活配套设施齐全,有中央公园、农贸市场、联华超市、学校、银行、医院等等。', '2004-06-09', '0.7元/月/平方米');
