INSERT INTO "public"."gaode_residential_region" VALUES ('B023B061NO', '330100', '120.135782,30.304998;120.135404,30.305455;120.135142,30.305804;120.136085,30.306321;120.136594,30.306629;120.137179,30.306017;120.135782,30.304998', '广兴新村', '杭州市拱墅区小河路46号', '杭州市', '0103000020E61000000100000007000000AC58FCA6B0085E406D585359144E3E40D8EF8975AA085E405166834C324E3E403A94A12AA6085E4069FCC22B494E3E40791EDC9DB5085E40F913950D6B4E3E401CB5C2F4BD085E405401F73C7F4E3E40ACAC6D8AC7085E4021054F21574E3E40AC58FCA6B0085E406D585359144E3E40', '14262.828287', '120.136151,30.305838', '商务住宅;住宅区;住宅小区', '', 'None', '', '29801', '广兴新村位于小河路42号,环境优美,98年左右的房子,共建有10幢房子,位于古镇小河直街旁边。广兴新村通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.15元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B061O2', '330100', '120.103476,30.308645;120.101535,30.308114;120.101163,30.308279;120.100673,30.308213;120.100305,30.308208;120.100123,30.308199;120.099829,30.309141;120.100293,30.309153;120.100278,30.309758;120.099639,30.309757;120.099535,30.310083;120.099565,30.310158;120.101526,30.310895;120.101596,30.310455;120.102643,30.310517;120.103575,30.308767;120.103476,30.308645', '广宇·西城年华', '杭州市西湖区申花路388号', '杭州市', '', '65660.755676', '120.1017,30.30958', '商务住宅;住宅区;住宅小区', '850个,地上50个;地下800个', '2.6', '260000平方米', '47542', '西城年华由广宇集团鼎力打造,位于丰潭路与申花路交汇处,西接九年一贯制的保叔塔实验学校分校,浙大紫金港校区前约800米,南邻政苑小区和规划中的省厅局机关办公区,东与60万平方米生态控制区仅一路之隔。周边规划有银泰购物广场、沃尔玛超市及医疗、体育相关服务中心。申花路、丰潭路、天目山路、莫干山路构成完善的交通网。广宇.西城年华主要在以下几个方面进行了创新:、改善型环境创造。广宇.西城年华在大环境优势的基础上,传承优生活内涵,按圆桌骑士精神规划,2万余平方米大花园、多个架空层花园及细节布景,创造户内外休闲、娱乐、健身生态活动空间,提升人与自然交流的环境档次,更主要的是改善了人与人之间的交流沟通平台,在这种环境里,工作的压力可以得到放松。提前启动的花园造景模式,更为业主创造了成熟的景观。第二、多元化空间设计。广宇.西城年华在改善型生活、标志型社区的基础上,缔造学院型地产开发模式,为高品质追求人群提供多元化空间组合。在房型设计上,体现了合理、舒适、高雅的空间艺术,提供98~168平方米的平层及部分大面积顶楼跃层户型。同时,创造了景观书房、走入式衣柜、景观阳台、艺术展廊等个性化空间,满足学习、健身、休闲、收藏等家庭内的多元化需求。第三、先进材质理念运用。广宇.西城年华本着可持续发展的设计理念,采用了先进材料、国际技术与创新理念相结合,主要体现在节能、隔音、生态、产品寿命等方面,比如断桥隔热、中空玻璃、内开内倒彩色铝合金窗、品牌户式机械新风系统、日立品牌电梯、外墙外保温技术以及屋面保温防水技术等等。第四、高品质生活成本控制。', '2005-06-23', '1.08元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B061ZC', '330100', '120.15921,30.187885;120.159123,30.187911;120.159058,30.187982;120.158956,30.189438;120.160954,30.189871;120.161087,30.189895;120.161135,30.189922;120.161154,30.189973;120.16114,30.190259;120.161058,30.191139;120.161081,30.19118;120.161155,30.191221;120.161511,30.191239;120.161649,30.19123;120.161841,30.191232;120.16203,30.19126;120.162205,30.19132;120.16216,30.191408;120.161933,30.191685;120.161789,30.191725;120.161017,30.19169;120.160976,30.192019;120.160942,30.192436;120.161732,30.19252;120.162261,30.192673;120.162338,30.192091;120.16236,30.191801;120.16254,30.191717;120.162691,30.191641;120.162904,30.191419;120.163067,30.191283;120.163294,30.191065;120.163781,30.190543;120.163838,30.190419;120.163887,30.190284;120.164252,30.188997;120.162481,30.18844;120.15921,30.187885', '国信嘉园', '杭州市滨江区滨江伟业路与滨盛路交汇处', '杭州市', '', '113730.570876', '120.161723,30.189797', '商务住宅;住宅区;住宅小区', '1:0.5', 'None', '140000平方米', '36666', '前瞻的眼光br国信嘉园位于钱塘江南岸杭州滨江区,从杭州市政府确立的城市规划中来看,早已将跨江发展列为重点。从现有情况来看,钱江四桥的具体操作,众多企业的渡江开拓表明了杭州城市的重心正在移动。滨江区的前途,国信嘉园的未来不可限量。br·心动的明天br对住宅而言,居住环境的要求与日俱增。国信嘉园紧邻钱塘江,遥望西湖群山,自然环境条件突出、空气清新,是居住的理想地带。新建的滨江新区拔地而起,良好人文环境、社会环境均符合现代人生活的要求。br·舒缓的区域br国信嘉园占地面积约207亩,是杭州现在少有大规模生活社区,容积率0.96,远低于杭州住宅区的普遍设置。区内规划齐整,各类住宅形式布局合理形成多个特色组团,区内水系与钱塘江相呼应,带来内外合一的美好环境。br·体贴的心灵br国信嘉园规划设计的主导思想是追求生活的舒适、悠闲、完美,所有的工作均为此主导思想所服务,无论是建筑设计、户型设计、环境设计均体现了设计师的良苦用心,让每一位业主由衷体会舒适的生活。', '', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B062ER', '330100', '120.1836,30.256031;120.183639,30.256294;120.183654,30.256434;120.183731,30.256586;120.183828,30.25669;120.183918,30.256752;120.184179,30.256843;120.184241,30.256847;120.184322,30.256864;120.184436,30.256887;120.184487,30.256927;120.184505,30.257096;120.184938,30.257078;120.185163,30.257065;120.185222,30.257046;120.18529,30.25701;120.185371,30.256975;120.185476,30.256948;120.185549,30.256938;120.185622,30.256938;120.185733,30.256947;120.185838,30.256974;120.18596,30.25702;120.186055,30.25707;120.186141,30.257124;120.186217,30.257212;120.186404,30.257183;120.186528,30.257176;120.186643,30.257181;120.186688,30.25721;120.18671,30.257255;120.186763,30.257606;120.186774,30.257681;120.186984,30.257671;120.187063,30.257658;120.187133,30.257629;120.1872,30.257548;120.187211,30.257467;120.187197,30.256898;120.187152,30.256002;120.187136,30.255971;120.187109,30.255943;120.187051,30.255928;120.184978,30.255986;120.1836,30.256031', '翰林花园(翰林街)', '杭州市上城区翰林街108号', '杭州市', '', '35420.017354', '120.185652,30.25656', '商务住宅;住宅区;住宅小区', '', 'None', '81693平方米', '39806', '翰林花园是一座高尚居住园区,位于下城环城东路以西,庆春路以南,交通流畅、环境优雅。名仕家园总占地76亩,总建筑面积81693平方米,建有格调高雅的多层公寓20幢、景观电梯房3幢,共505户。车位200多个。园区容积率仅1.5,并享有搞绿化率。高标准的间距规划,使整个园区的居住空间享有充足的阳光和开阔的视野。翰林花园优越的规划现代风格的建筑,精致的配套,构成一个独具人文格调的高品位园区,成为城西独树一帜的新一代房产代表。', '', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0631Z', '330100', '120.176443,30.279872;120.17649,30.279763;120.176551,30.279693;120.176606,30.279627;120.176425,30.279635;120.176372,30.279594;120.176381,30.279339;120.176191,30.279345;120.176205,30.278523;120.175702,30.278586;120.175755,30.279004;120.175412,30.279056;120.175403,30.279123;120.175306,30.279169;120.175283,30.279233;120.174782,30.279269;120.174775,30.278738;120.174671,30.278743;120.174077,30.278712;120.173998,30.278692;120.174016,30.278961;120.173984,30.279162;120.17386,30.279683;120.173825,30.279843;120.173811,30.280123;120.173726,30.280332;120.173637,30.280837;120.174263,30.281014;120.17512,30.281179;120.175631,30.281272;120.176101,30.281298;120.176083,30.281046;120.176177,30.280752;120.176377,30.280051;120.176443,30.279872', '和平小区(朝晖路)', '杭州市下城区朝晖路126号', '杭州市', '', '50363.207407', '120.175095,30.280009', '商务住宅;住宅区;住宅小区', '', 'None', '', '35393', '和平小区共29栋,其中1栋小高层,另28栋为多层,车辆进出分流,有固定的车库,小区环境舒适,闹中取静,绿化率高,生活配套成熟,餐饮、超市、银行、学校、医院、公交站点近在咫尺,配套幼儿园。生活非常方便,多条主干道相拥环抱,出行便利,非常宜居。小区建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区内居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.45-0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0635V', '330100', '120.225283,30.19165;120.225778,30.191606;120.22573,30.191345;120.225683,30.191105;120.22565,30.191076;120.223574,30.191326;120.22364,30.191732;120.223657,30.191762;120.223695,30.191768;120.225283,30.19165', '河畔花园', '杭州市滨江区古塘路31号', '杭州市', '', '9645.168187', '120.224702,30.191442', '商务住宅;住宅区;住宅小区', '', 'None', '', '23446', '小区环境好、新楼盘小区', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0636L', '330100', '120.138943,30.180798;120.13888,30.180724;120.138753,30.180678;120.134679,30.18031;120.134665,30.180776;120.134866,30.180899;120.134817,30.181062;120.134626,30.181765;120.133728,30.184162;120.134612,30.184658;120.135459,30.184847;120.136235,30.18501;120.136833,30.185114;120.13818,30.182335;120.138943,30.180946;120.138943,30.180798', '贺田尚城', '杭州市滨江区六和路365号', '杭州市', '', '146309.938721', '120.136201,30.182566', '商务住宅;住宅区;住宅小区', '车位配比：1:1', '1.63', '296591平方米', '34338', '尚城,江景之城,风尚之城,知性生活之城。位于钱塘江壮美辽阔的江景南岸,六合路以西,永久河以南,新生路南北两侧,与六和塔、浙大三部隔江相望。地处高新技术产业开发区之江科技工业园;周边中国美院、浙工大国际学院等名校林立;UT斯达康、东方通信、浙大中控等高科技企业环伺左右。占地面积157545平方米,总建筑面积296591平方米,是以多层及小高层低密度住宅为主的大型复合景观风尚社区。尚城的人文住宅和灵动空间,将生活风尚演绎得淋漓尽致。五层的多层和十层的小高层,以现代规划思想,寻求与周围科技园区的和谐相融。建筑造型更多体现了江畔传统居住文脉,风格现代而多样。尚城的建筑品格,在精致细腻中,发挥建筑空间的多彩表情;在材质质感之外,感知艺术的韵律和人文的风情。外挑廊式景观阳台,正以独有的浪漫情调,邀阳光入室,与和风细雨倾谈。大面积落地玻璃的通透之窗,与顶层威卢克斯阳光天窗,让尚城的全明户型设计再度博得连连赞叹。南向采光的主卫盥洗间的设计突破,将人文关怀在细节处彰显无遗。强调动静分离、内外分区、灵活有致和趣味性空间,让居住风尚在放松、悠闲中张扬。小区内有贺田公立幼儿园,有室内、室外游泳池,网球场,壁球室,儿童游乐场,贺田会所,六和公园,休闲吧,联华超市,工行ATM机,地面、地下车库……。', '2013-04-20', '1.4元/月/平方米');
