INSERT INTO "public"."gaode_residential_region" VALUES ('B023B068QI', '330100', '120.199944,30.231228;120.20053,30.231204;120.200547,30.231153;120.200608,30.22963;120.200572,30.229543;120.200502,30.229475;120.200137,30.229148;120.198395,30.230568;120.199086,30.231256;120.199507,30.231597;120.199787,30.231313;120.199898,30.23123;120.199944,30.231228', '近江四园', '杭州市上城区近江南路6号', '杭州市', '', '28579.767521', '120.199719,30.230428', '商务住宅;住宅区;住宅小区', '', '2.4', '800000平方米', '40757', '近江家园四园小区交通一般,公交车站有点远,出行不变,生活配套一般,小区环境还好,比较清爽,物业管理过的去,老社区,适合过度!', '', '0.45-4.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0690G', '330100', '120.20771,30.272746;120.208426,30.272902;120.208957,30.273055;120.208944,30.273817;120.209949,30.273802;120.209948,30.273619;120.210028,30.273624;120.210024,30.273069;120.210006,30.272873;120.209927,30.272874;120.20991,30.272526;120.209906,30.272179;120.210661,30.272174;120.210708,30.27054;120.20797,30.270571;120.207872,30.270583;120.207771,30.27064;120.207747,30.270721;120.207742,30.270819;120.207708,30.27173;120.20771,30.272746', '景华苑(景华路)', '杭州市江干区昙花庵路190号', '杭州市', '', '66738.869988', '120.209167,30.271881', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '景芳六区位于江干区新塘路272号,房子是景芳一代中房龄较新的,景芳地处杭州的老城区,地理位置优越、交通便利、环境优雅,小区出门就是公交起点站,地铁和超市小区5路程能到达。  景芳六区是质量较高、配套完善的住宅小区。生活安静,环境优美,生活氛围浓厚等优势为您创造了优良居住环境。园区倡导一种快节奏、低生活成本、高娱乐的都市人生活方式。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0690I', '330100', '120.15118,30.184828;120.150942,30.184931;120.150818,30.185092;120.149684,30.18577;120.148606,30.186423;120.148518,30.186584;120.148742,30.187035;120.149104,30.187781;120.149668,30.187541;120.149777,30.187481;120.149875,30.187389;120.150354,30.187085;120.150496,30.186838;120.150541,30.186862;120.150777,30.186445;120.150962,30.186379;120.151802,30.18626;120.151318,30.185143;120.15118,30.184828', '景江苑', '杭州市滨江区江南大道4348号', '杭州市', '', '39771.413917', '120.150103,30.186329', '商务住宅;住宅区;住宅小区', '', '1.69', '', '32910', '之江公寓·景江苑位于钱塘江一桥南岸,与六和塔隔江相望,南临江南大道,西靠西环线,紧临之江度假村,由9幢十至十九层的高层、小高层电梯公寓、一幢二层的休闲中心呈围合状有机组合而成。社区的中庭景观,聘请环境设计大师——香港贝尔高林公司倾力打造,是一座充满生态魅力的现代家园。  之江公寓·景江苑充分体现了“以人为本”的开发理念,在优越的地理环境中,创造一个富有现代气息、品位高雅的生活栖息地,极具创造性地将独门独户的私有庭院引入到高层住宅中,形成真正的空中别墅生态景观,使人足不出户就能接触自然,为业主带来更加完美的生活空间,满足业主回归自然的需求。  景江苑的中庭设计由贝尔高林倾力打造、溪流、广场、绿草、草木与住宅建筑相辅相成,建筑采用点式的布局,景观设计上以均好性为特色,并将建筑与自然,自然与人文完美地融合在一起。参照的生活蓝本进行规划设计,自然起伏的坡地,蜿蜒的鹅卵石小径,涓涓的细流,喷涌的泉水,艺术的雕塑、巧夺天工的假山,娇艳的花朵,碧绿的小草,所有美丽的景观都在融汇,让你每天都能享受美妙的景致。极具特色的景观小品,有着很高的艺术价值,让您的生活中充满了艺术的浪漫气息。', '2004-05-30', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06922', '330100', '120.200726,30.242283;120.200279,30.24263;120.201234,30.243746;120.201316,30.243875;120.201385,30.243918;120.201451,30.24389;120.201508,30.243826;120.201515,30.243823;120.201641,30.243713;120.202322,30.243115;120.202045,30.242912;120.202001,30.242954;120.201721,30.242715;120.201579,30.242594;120.201445,30.242478;120.201398,30.242451;120.201353,30.242436;120.201222,30.242425;120.201123,30.242441;120.200827,30.242219;120.200726,30.242283', '静安花苑(下车路)', '杭州市江干区秋涛路550号', '杭州市', '', '15067.429989', '120.201274,30.243021', '商务住宅;住宅区;住宅小区', '', 'None', '', '31217', '静安花苑位于观音塘路,由十幢多层建筑组成,旁边是四季青中学,周边菜场、银行等配套齐全,离观音塘小区公交站较近,出行方便。配套成熟', '', '0.15-1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0699L', '330100', '120.201126,30.239627;120.200564,30.240046;120.200077,30.240443;120.200395,30.240725;120.200793,30.241063;120.201175,30.241425;120.201404,30.241607;120.201856,30.241178;120.202266,30.240777;120.201476,30.239955;120.201126,30.239627', '居安坊', '杭州市江干区秋涛路550号静怡社区', '杭州市', '', '19575.744202', '120.201203,30.240606', '商务住宅;住宅区;住宅小区', '', 'None', '', '34361', '居安坊位于黄金路段、交通方便,小区拥有大型地下车库,实行智能封闭式管理。简约、质朴、典雅的建筑与自然环境形成和谐。附近商业网点遍布,酒楼食肆、综合市场、医院、学校等生活配套一应俱全。体现“自然、和谐、舒适”的主题。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06BLS', '330100', '120.160598,30.17608;120.160593,30.175135;120.160601,30.173866;120.15875,30.173865;120.158761,30.175869;120.15958,30.175851;120.159908,30.176079;120.160598,30.17608', '立志园', '杭州市滨江区滨文路476号', '杭州市', '0103000020E610000001000000080000006473D53C470A5E40CC7A3194132D3E40DCBDDC27470A5E408D62B9A5D52C3E401DAD6A49470A5E40E7E26F7B822C3E405C8FC2F5280A5E4046EBA86A822C3E4056B8E523290A5E40566133C0052D3E402046088F360A5E400AF83592042D3E409A97C3EE3B0A5E402C836A83132D3E406473D53C470A5E40CC7A3194132D3E40', '35104.794126', '120.159699,30.174914', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06D8Z', '330100', '120.177174,30.23669;120.177619,30.237376;120.177919,30.23786;120.17831,30.23768;120.178625,30.237521;120.178298,30.237002;120.177938,30.236444;120.177875,30.236351;120.177174,30.23669', '陆家河头小区', '杭州市上城区江城路636-2号', '杭州市', '', '9816.593086', '120.177902,30.237106', '商务住宅;住宅区;住宅小区', '', '20', '450平方米', '33725', '陆家河头小区属于老小区,交通便利,户型好,结构正气,周边的配套设施都齐全,但面积比较小,绿化和物业不是很好。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06F2Z', '330100', '120.161837,30.185841;120.161763,30.186057;120.15921,30.185662;120.159105,30.187657;120.161183,30.188051;120.163271,30.188492;120.163626,30.187391;120.163948,30.18641;120.16395,30.186319;120.163908,30.186265;120.16278,30.186018;120.161837,30.185841', '南都·江滨花园', '杭州市滨江区滨盛路4199号', '杭州市', '', '88856.945876', '120.161479,30.186995', '商务住宅;住宅区;住宅小区', '', 'None', '', '33502', '南都·江滨花园位于钱江南岸之江居住区内,钱江一桥与钱江四桥之间,杭州之江度假村附近。西临海纳大道,东沿火炬大道,对望凤凰山,傍依钱江美景。园区占地面积140余亩,总建筑面积10万余平方米,由28幢住宅组成,可容纳住户600余户,泊车率达70%。南都·江滨花园是低层、低密度、低容积率、高绿化率的三低一高式人性住宅,源于德国理性主义的建筑风格简洁明快,住宅两两对称,形成9个组团。所有户型均坐北朝南,采用大开间、短进深的全明设计,户型面积从115-380平方米左右区域中心设置人工溪流,园区绿化率超过45%。南都·江滨花园是研究人的需要,真正“以人为本”的宜人居住区。它是杭州房地产市场发展的新一代住宅产品,代表了崭新的居住方式和生活标准。园区(一期)计划在2001年底竣工,2002年上半年交付。南都·江滨花园是杭州市第一个以准现房形式销售的项目,荣获“全国人居经典楼盘”称号。滨江新城以永久河、长兴路为分界线,南北职能分为:北部为环境优美、公建完善的居住生活。南部是以高新技术产业为主的科技园区和文化教育园区。目前滨江新城有大型的农贸综合市场、中南建材市场等。规划在江晖路和北塘河之间,滨盛路以北地区形成商贸中心,主要布置商贸、金融、文娱、康体等大型市级公建项目,其中滨盛路性质为商业街。目前有新武警医院、杭州浦沿中心卫生院、杭州江南胃胆研究院等。投资一亿多元,按照三级医院标准建造的新武警医院,于2000年9月28日正式启用,目前已成为武警部队第一流的现代化综合医院。另外,在江虹路与北塘河之间的临江地块规划有一所市级医院:在中兴西路以北、火炬大道与信城路之间,滨盛路以南规划有区域性医院。南都·江滨花园建筑现代而简洁,住宅原型取自HPP设计事务所设计的科隆贝多芬住宅区。区域中心设置有贯穿东西的人工河道,四层为主的低层住宅建筑和小高层建筑为内部的居住功能提供了亲切的空间。各幢住宅两两相邻,高低错落,形成活泼的组团围合空间。精心设计的花园为建筑群提供了更多的色彩,使简洁的建筑成为环境的最好背景。层顶的柔和曲线舒缓了小区的视觉压力,住宅顶层为家庭提供了大平台与地面花园形成呼应。屋顶全透明工作室是艺术家或自由职业者的理想选择。音乐发烧友可选择带视听室的底层住宅。环形车道彻底实现了人车分流,各个组团的地下车库使业主停车进出非常便利。在整个小区的环境规划上,力求丰富、自然,并且功能分区明确,使建筑与环境相互交融。在南都·江滨花园里,所有的因素都有机地统一在一起。建筑的高低错落与景致的起伏变化相互辉映,形成人们理想中的美丽家园。', '', '0.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06GOR', '330100', '120.209311,30.260919;120.209319,30.260277;120.209346,30.260161;120.209418,30.260025;120.209673,30.259593;120.210451,30.260139;120.211049,30.260552;120.211237,30.260667;120.211341,30.260691;120.211323,30.260906;120.209617,30.260911;120.209311,30.260919', '钱江六苑', '杭州市江干区太平门直街530号', '杭州市', '', '14452.7968', '120.210112,30.260449', '商务住宅;住宅区;住宅小区', '', '2', '112000平方米', '37429', '小区成熟,绿化率高,地段优越,地铁二号线口,附近配套齐全,乐购超市,庆春银泰3分钟!邵逸夫医院!各银行网点就在旁边', '', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06GQ6', '330100', '120.198868,30.236466;120.198235,30.235948;120.198013,30.236189;120.1991,30.23716;120.199445,30.236906;120.199528,30.236829;120.199542,30.236795;120.199551,30.236751;120.199555,30.23665;120.199115,30.236627;120.199069,30.236622;120.199043,30.236613;120.198935,30.236519;120.198868,30.236466', '钱江苑', '杭州市上城区钱江路580号1幢附近', '杭州市', '', '5611.870818', '120.198794,30.23659', '商务住宅;住宅区;住宅小区', '', '2', '', '38254', '钱江苑位于钱江路和衢江路交叉口,小区共3幢房,1幢共10层,2幢共15层,3幢共7层 。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.5-0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06GR6', '330100', '120.202327,30.237642;120.202756,30.23731;120.202782,30.237271;120.202774,30.237228;120.20242,30.236928;120.20232,30.236866;120.202255,30.236861;120.202192,30.236883;120.201965,30.237058;120.201803,30.237171;120.201284,30.237124;120.201035,30.237115;120.200984,30.237132;120.201492,30.237651;120.201112,30.237895;120.201009,30.237787;120.200805,30.237778;120.200413,30.2378;120.200308,30.237787;120.200112,30.237693;120.200038,30.237636;120.199814,30.237825;120.19979,30.237864;120.199802,30.23792;120.200319,30.238391;120.200675,30.238736;120.200916,30.238948;120.200964,30.238967;120.201029,30.238959;120.201086,30.238917;120.201243,30.238794;120.201315,30.238714;120.20135,30.238635;120.201434,30.238443;120.201481,30.238336;120.20153,30.238245;120.201579,30.238204;120.201741,30.238067;120.202327,30.237642', '钱塘名都(清江路)', '杭州市上城区上城钱江路628-640号', '杭州市', '', '21774.143051', '120.201299,30.237868', '商务住宅;住宅区;住宅小区', '', '2.5', '110000平方米', '38369', '龙生·钱塘名都规划有小高层、高层住宅、写字楼组成,一期将于六月份结顶,二期计划2003年底开工。 钱塘名都项目总建筑面积约11万平方米,由6幢高层建筑构成,是钱江新城区块难得的高档楼盘。开阔的新城景观,得天独厚的自然环境、便捷的交通网络,齐全的配套设施,让钱塘名都凭借钱江时代发展之契机,创造一个足以震憾人心的新城市的生活空间。 钱塘名都利用其独特的地理自然景观优势,将名都生活与新城风光有机结合,借助地块直面新城及钱塘江的有利条件,充分利用自然景观至经典的板式高层建筑中,全新打造别致江景生活空间,未来新城,一览无余。 钱塘名都打开窗户,迎来美好未来。 钱塘名都在建筑造型、环境色彩、空间节奏、以及新城意象、环保科技等方面都进行有益的探索。建筑本身与新城市的天际线有机融合,自成杭州东大门一道亮丽的风景线。 钱塘名都的景观设计充分释放周边环境资源与钱塘江自然景观,不留痕迹地运用现代园林设计手法,来表现园区内精致而贴近生活的水景,自然与钱江时代文化一脉相承,营造出一个高尚的新城市的生活空间。园区整体布局严谨、大方、合理,把城市绿化、园林景观串成一个有机而大气的整体,园区视野开阔、绿意常驻。整个园区充满生命气息,彰显名都生活品质。', '2005-01-16', '1-1.5元/月/平方米');
