INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6R', '330100', '120.14194,30.175934;120.141943,30.175721;120.141933,30.175325;120.141914,30.174551;120.141719,30.174487;120.141372,30.1744;120.141177,30.174367;120.141112,30.174381;120.139604,30.174022;120.139606,30.176099;120.141931,30.176098;120.14194,30.175934', '天鸿君邑小区', '杭州市滨江区东信大道与六和路交叉口西南150米', '杭州市', '', '38349.139238', '120.140714,30.175188', '商务住宅;住宅区;住宅小区', '892个', '2.5', '12平方米', '27593', '天鸿君邑居于东信大道旁,踞滨江居住核心,揽钱塘江景,望六和古风,是一方繁华中更享静谧的人间美境,也是杭州滨江区罕有的精装公寓住品。园区总建筑面积近16万平米,由精装修高层公寓,精装修服务式商务楼和休闲商业街恢弘筑就。  天鸿君邑由钱塘江大桥、复兴大桥快速对接大杭州繁华腹地,杭州高新公建中心、高教园区等大型商务配套环伺周围。天鸿君邑约15000平米的大型中央广场式花园,社区独配的休闲商业街,而入户花园作为天鸿.君邑户型特色之一,创造了公寓中的别墅级豪华配置。', '2008-09-20', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6Y', '330100', '120.168656,30.190724;120.165858,30.189592;120.165728,30.189599;120.165664,30.189689;120.165364,30.190661;120.164928,30.19221;120.1646,30.19341;120.16694,30.194172;120.167362,30.19336;120.168656,30.190724', '钱江水晶城', '杭州市滨江区滨盛路4402号', '杭州市', '', '101348.397189', '120.166493,30.191879', '商务住宅;住宅区;住宅小区', '1700', '2.5', '', '58068', '钱江水晶城是继钱江彩虹城后钱江南岸又一座大规模的一线江景高尚住宅园区;钱江水晶城由9幢高层住宅、沿江一线2幢超高层楼王级住宅,以及一条长达270米的商业街区组成,建筑容积率2.5,建筑密度不到18%。    景观设计围绕园区内南北两大景观内庭,以森林、河流、城堡、庄园和广场等自然人文意象,结合经典传承的新欧洲艺术,营造欧洲盛行的新奢华主义特色园林,并在园区内的各个围合空间,结合建筑的公共部位,通过造坡、树阵、水系、园雕和铺装的组合与艺术创意,形成各个组团的主题景观。    尽享滨江区完备教育、商业配套、高新区公建中心、高教园区等大型生活组团簇拥左右,更紧邻滨江区最为成熟的滨盛路生活圈。社区内精心设有尊贵VIP俱乐部、游泳池、欧式风情商业街等丰富多彩的生活配套,奢华品位浑然天成', '2012-08-31', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6Z', '330100', '120.147542,30.171207;120.148153,30.169334;120.148178,30.169195;120.14818,30.169081;120.14815,30.168967;120.146946,30.168605;120.145873,30.170746;120.147542,30.171207', '银爵世纪公寓', '杭州市滨江区浦沿街道715号', '杭州市', '0103000020E610000001000000080000005532005471095E40A5D8D138D42B3E407973B8567B095E40D2191879592B3E4026FF93BF7B095E408FA50F5D502B3E40F67AF7C77B095E40FE5F75E4482B3E40C139234A7B095E406D1ADB6B412B3E40CB11329067095E402CF180B2292B3E40A417B5FB55095E403EEC8502B62B3E405532005471095E40A5D8D138D42B3E40', '32892.202018', '120.147133,30.169934', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFSY', '330100', '120.147144,30.189984;120.146989,30.190277;120.148207,30.190675;120.14949,30.191085;120.149431,30.190472;120.149463,30.189138;120.14947,30.188818;120.149311,30.188419;120.1491,30.188155;120.148995,30.188116;120.148826,30.188181;120.148271,30.188486;120.147144,30.189984', '德圣银杏汇', '杭州市滨江区闻涛路与东信大道交叉口向西600米', '杭州市', '', '41010.69157', '120.148536,30.189666', '商务住宅;住宅区;住宅小区', '车位比1:3', '3.16', '190000平方米', '', '中国银杏汇,原乡意大利当代学院派建筑艺术大师邦德亚历维多作品。项目一直致力于营造人文、艺术的品质和品味。项目身处钱塘湾艺术馆的银杏汇,对望西湖世界文化遗产,收藏杭州之江湾,“山、水、塔、桥、城”——杭州精华的自然资源和人文资源,收藏在列。INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BD1H', '330100', '120.169307,30.279877;120.167191,30.279319;120.167221,30.279194;120.167298,30.278752;120.167304,30.278698;120.16728,30.278629;120.167272,30.278601;120.167615,30.278513;120.16765,30.278497;120.167666,30.278363;120.168591,30.278571;120.168792,30.278601;120.169551,30.278724;120.169307,30.279877', '武林府', '杭州市下城区中山北路600弄80号', '杭州市', '', '21245.415712', '120.168403,30.279084', '商务住宅;住宅区;住宅小区', '1:1.2', '3', '140000平方米', '50929', '', '2012-09-30', '7.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BFFY', '330100', '120.175501,30.23294;120.175417,30.232966;120.175011,30.233133;120.174919,30.233191;120.175331,30.233832;120.175771,30.234514;120.176454,30.234147;120.176413,30.234063;120.17586,30.233439;120.175579,30.233112;120.175501,30.23294', '响水坝', '杭州市上城区上城江城路470-492号', '杭州市', '', '9688.048303', '120.175673,30.233729', '商务住宅;住宅区;住宅小区', '', '1.4', '', '34994', '老小区,交通便利,户型好,结构正气周边环境:太庙公园,世纪联华超市,金衩袋巷菜场,紫阳幼儿园,抚宁巷小学,建兰中学。离城站火车站3站', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BIDJ', '330100', '120.202805,30.236018;120.202847,30.236013;120.203002,30.235984;120.203194,30.235914;120.202697,30.235467;120.202203,30.23503;120.20215,30.235027;120.202102,30.235047;120.201906,30.235194;120.201609,30.235426;120.201319,30.235647;120.201509,30.235773;120.201719,30.235875;120.201992,30.235948;120.202114,30.235978;120.202425,30.236029;120.202585,30.236043;120.202649,30.236044;120.202805,30.236018', '南光坊', '杭州市上城区富春路266号', '杭州市', '', '9272.839732', '120.202237,30.235623', '商务住宅;住宅区;住宅小区', '', 'None', '', '40470', '学区房,附近有大型菜场,超市,楼层好物业类型是多层住宅,小区开盘时间在1998年,就在钱江三桥附近,属于钱江新城的房子', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BMJB', '330100', '120.253307,30.168222;120.253491,30.168086;120.253794,30.167824;120.254288,30.168235;120.254459,30.168033;120.254658,30.167819;120.254685,30.167757;120.25468,30.167702;120.254616,30.167664;120.254551,30.167578;120.254568,30.167048;120.254557,30.166675;120.254508,30.166581;120.254363,30.166465;120.254084,30.166338;120.25351,30.166572;120.253309,30.166402;120.253097,30.166421;120.252641,30.166718;120.252206,30.167039;120.252107,30.167126;120.252122,30.167173;120.25278,30.16777;120.252953,30.167915;120.253307,30.168222', '华瑞·湘湖林语', '杭州市萧山区城厢街道下湘湖路8号', '杭州市', '', '29136.649299', '120.25355,30.167244', '商务住宅;住宅区;住宅小区', '205', '1.8', '', '18425', '华瑞.湘湖林语位于休博园湖畔区东北侧,紧邻下湘湖河,社区东南方可近观西山,西南向可远眺湘湖,鸟瞰休博园,即能享受湘湖美景,又可体会休博园的浪漫与休闲,是一个理想的栖居场所!湘湖林语社区占地约2万平方米,总建筑面积达5万平方米,共由5幢11-18层小高层建筑组成,共有住宅近300户,户型面积从70-150㎡不等。  华瑞.湘湖林语公寓所处区位,极具发展潜力,目前社区东侧的金鸡路延伸段、南面的彩虹大道均已列入市政规划,待两条城市主干道开通后,湘湖林语约2000米范围内,向东可抵达市心广场、萧绍路商业区,往北可直达金城路、人民广场,向西经彩虹大道可至风情大道,游湘湖、通杭州均十分便捷。  城市与自然的共享地段,繁荣与休闲的和谐交融,使湘湖林语既可以享受现代城市的丰腴物质,又能亲享自然,感受生活真谛。   湘湖林语社区拥有如下配置:   ◎节能保温配置:外墙内保温系统、双层中空玻璃、顶层隔热层;   ◎电梯配置:高档东芝品牌电梯,运载速度可达1.75米/S,可直达地下车库;   ◎智能化配置:周界防越报警系统、闭路电视监控系统、可视对讲系统、电子巡更系统、门禁管理系统、公共广播系统、家庭综合智能箱系统等; ◎健身会所设置:湘湖林语从日后业主健康生活考虑,集中设置健身会所,为业主提供一个健身休闲、邻里交流的平台。', '2007-06-02', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQ45', '330100', '120.286629,30.165688;120.286476,30.164925;120.285774,30.165036;120.286006,30.166097;120.286025,30.166139;120.286176,30.16615;120.286631,30.166099;120.286629,30.165688', '柠檬公寓(通惠中路)', '杭州市萧山区通惠中路58号', '杭州市', '0103000020E610000001000000080000007445292158125E40F3565D876A2A3E40B0C56E9F55125E40F54A5986382A3E400403081F4A125E40A4A99ECC3F2A3E406D1D1CEC4D125E40B6F63E55852A3E40A835CD3B4E125E401497E315882A3E409B3924B550125E40FB3A70CE882A3E4044C18C2958125E40F7E5CC76852A3E407445292158125E40F3565D876A2A3E40', '7300.445438', '120.286239,30.165542', '商务住宅;住宅区;住宅小区', '1.3', '4.5', '35000平方米', '14751', '柠檬公寓是由浙江金帝集团投资(浙江金帝集团在萧山开发的项目有金色钱塘、高新科技广场、文源广场等),由杭州金泰房地产开发有限公司开发的高层单体公寓项目,地处通惠路与萧绍路交汇处,西面有乐购超市,北面靠商检局,东面有成熟居住社区,萧山大型商业城就在项目附近,生活非常之便利。 整个项目总建筑面积约4万方,由单体公寓和商场组成。柠檬公寓建筑是由两梯六户组合而成,户户均南北朝向,围合屋顶中心绿化广场是项目一大亮点,实现生态小区概念。', '2008-02-29', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQ6I', '330100', '120.169738,30.214758;120.170262,30.215389;120.171038,30.216274;120.171112,30.216336;120.171236,30.216291;120.171543,30.216634;120.172167,30.216213;120.17089,30.214841;120.170372,30.214352;120.169738,30.214758', '复兴东苑', '杭州市上城区复兴路北口', '杭州市', '', '19099.853646', '120.170938,30.2155', '商务住宅;住宅区;住宅小区', '', 'None', '', '36365', '小区环境佳,是居住的最佳选择择。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BTVD', '330100', '120.157495,30.184951;120.156733,30.184834;120.156536,30.184806;120.155968,30.184683;120.155889,30.184925;120.155677,30.185723;120.156158,30.185811;120.157038,30.185946;120.158135,30.186132;120.158916,30.186305;120.159005,30.18519;120.157495,30.184951', '钱塘景苑', '杭州市滨江区伟业路399号', '杭州市', '', '30969.481855', '120.157396,30.18548', '商务住宅;住宅区;住宅小区', '', 'None', '', '28431', '钱塘景苑位于滨江区滨盛路与伟业路交叉路口,小区对面是彩虹城,前面是联庄,周边有动漫之都、元天科技、信雅达、创新大厦、龙禧、华荣、诺基亚、西门子、恒生、三维通信等等众多软件和电子通信单位。居住环境安静,交通方便快捷,生活配套一应俱全,方便居民的日常生活。创造具有城市文化和精神自由的、开放的、生态的、恬静的生活空间。体现“自然、和谐、舒适”的主题。', '', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BU7R', '330100', '120.067948,30.254549;120.068275,30.253991;120.067593,30.2537;120.067179,30.254188;120.066417,30.253835;120.06603,30.254533;120.066414,30.254709;120.066122,30.255331;120.068364,30.256434;120.069171,30.255191;120.067948,30.254549', '留庄', '杭州市西湖区天目山路389号', '杭州市', '', '42745.768567', '120.067543,30.255039', '商务住宅;住宅区;住宅小区', '', '1.17', '78000平方米', '24780', '留庄作为高级公寓的建筑类型开发,以丰富的建筑形态和空间形态、极具差异性的户型设计、完备的功能空间来营造官邸式的家居生活。生活与大自然紧密结合,完全融入到这西溪湿地公园的生态环境当中。建筑单体:与自然美景相得益彰的沉稳华美留庄的建筑单体造型沉稳华美,浅米色石材外墙、坡屋顶构造、正南正北的朝向、廊与柱的结合、私家花园的设计、高级VIP式会所的设置将留庄以官邸为蓝本的设计意图表现。每个户型,无论候客厅、起居室、餐厅、书房还是走廊都宽敞气派而又相对私密,满足主人生活、社交需要的同时,恰如其分地表达出主人的身份尊宠感。室内设计:深具古典美的新帕拉蒂奥风格为更好地吻合目标客户的审美取向,留庄在引入市场上罕见的帕拉蒂奥风格的同时,又融入东方元素的设计与现代工艺,力求使之呈现出中西合璧、优雅瑰丽的设计效果。', '2007-09-30', '8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY26', '330100', '120.200611,30.234115;120.200588,30.234041;120.200403,30.234045;120.200313,30.233964;120.19891,30.235258;120.1996,30.235833;120.200909,30.234707;120.20093,30.234524;120.201022,30.23422;120.201068,30.234097;120.200611,30.234115', '耀江福村', '杭州市上城区衢江路与富春路交叉口钱丰酒店后面', '杭州市', '', '16995.838376', '120.200023,30.234861', '商务住宅;住宅区;住宅小区', '', 'None', '112000平方米', '37993', '耀江福村由杭州城建开发有限公司 开发,2000年竣工,耀江福村物业类型是多层住宅,小区开盘时间在1998年, 就在钱塘江边上,属于钱江新城的房子 耀江福村位于富春路与衢江路交叉口。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.8元/月/平方米');
