INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13JEH', '330100', '120.183129,30.218388;120.183396,30.218206;120.183516,30.218107;120.183668,30.217929;120.183966,30.218073;120.184585,30.218395;120.184719,30.218499;120.185517,30.217851;120.185554,30.217765;120.185528,30.217679;120.183131,30.216374;120.179839,30.214339;120.178326,30.216205;120.178295,30.216371;120.179215,30.217486;120.180006,30.218358;120.180062,30.218376;120.180133,30.218333;120.180471,30.218513;120.180628,30.21861;120.180756,30.218668;120.180967,30.218721;120.181333,30.218773;120.181597,30.218796;120.181773,30.218788;120.182137,30.218754;120.182456,30.218677;120.182972,30.218496;120.183129,30.218388', '春江花月', '杭州市上城区钱江路158号', '杭州市', '', '151266.480513', '120.181418,30.216922', '商务住宅;住宅区;住宅区', '', '2.11', '440000平方米', '49044', '位于杭州钱塘江畔,是杭州江景住宅的典范作品。一、规划绿城·杭州春江花月地处钱塘江北岸,沿江长700多米,区域内地形开阔、临江傍山,自然环境得天独厚。作为江景住宅,春江花月在总体规划布局和建筑构成不仅考虑园区居住环境和景观的品质,而且关注未来城市的整体之美。环绕超大型的中央花园,33幢高层和小高层住宅疏落有致,层次分明。', '2002-09-30', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13MD0', '330100', '120.18755,30.245758;120.188242,30.245628;120.188802,30.245613;120.188855,30.245612;120.188886,30.245602;120.18889,30.245586;120.18879,30.245287;120.188562,30.244746;120.188373,30.244461;120.188352,30.244455;120.188329,30.244459;120.187995,30.244626;120.187956,30.244642;120.187892,30.244649;120.187821,30.244659;120.187774,30.244655;120.187416,30.245145;120.187406,30.245237;120.18755,30.245758', '清泰南苑2期', '杭州市上城区清江路10号', '杭州市', '', '11540.935265', '120.188114,30.245174', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13MGI', '330100', '120.157033,30.190667;120.156629,30.190662;120.156284,30.190697;120.15562,30.190766;120.155543,30.191225;120.155494,30.19203;120.157001,30.192111;120.158331,30.192165;120.158472,30.192057;120.158605,30.190833;120.158421,30.190791;120.157725,30.190734;120.157341,30.190696;120.157033,30.190667', '彩虹豪庭', '杭州市滨江区伟业路与文涛路交叉路口', '杭州市', '', '37715.634795', '120.15705,30.191411', '商务住宅;住宅区;住宅小区', '600', '2', '100000平方米', '51843', '项目介绍:钱江彩虹豪庭座落于杭州钱塘江南岸,位于钱江·彩虹城东北侧,总建筑面积约10万平方米,由6幢高层住宅组成,主力户型约260平方米,为钱江南岸一线江景精装修豪宅住区。    钱江彩虹豪庭直面壮阔的钱塘江,左看凤凰山、六和塔和钱塘江一桥,右望杭州城市景观,历史与城市合抱,风景与生活独揽,拥有“半边山半边城”无可替代的江景视野。    钱江彩虹豪庭6幢高层建筑结合钱塘江的流向,有序排布,大气磅礴,形成户户迎江的全江景格局,开阖有序的空间和半围合的规划,实现园区外有浩瀚大江,内有风情雅园的空间格调。    钱江·彩虹豪庭传承典雅主义风格,提取西方建筑语汇和典型元素,融合现代建筑的构筑手法,将尊容华贵与典雅大方的设计意象周全展现,竖向线条的强调,柱饰细部的韵律,墙面石材的运用,渗透了典雅主义风格独有的细节感动。    钱江彩虹豪庭主入口大堂、住宅建筑入户大堂、各单元楼层电梯厅全面实施精装修,用材、部品和设备精挑细选,星级酒店装修标准的艺术和优雅,营造出回家的荣耀和归属。    钱江彩虹豪庭住宅室内实行精装修,各厅室硬装到位,厨卫全装到位,窗系铝合金、厨房装配、卫浴设备全部选用欧系高档品牌,彰显欧洲工业设计的精神和工艺制作的品质,引领欧美生活时尚的理性主义。    钱江彩虹豪庭独创VIP财经人文俱乐部,专设室内恒温游泳池,加盟杭州高端商业金融商圈团体和论坛,在休闲养生之时轻松实现志同道合的精神对话。    钱江房产与浙江国大雷迪森酒店管理有限公司精诚合作,引进五星级酒店管理标准,造就钱江·彩虹豪庭专业、周到的品质服务。    1、门窗:意大利阿鲁克断桥隔热系统门窗、皮尔金顿Low-e中空玻璃2、厨房电器:德国西门子厨房电器(冰箱、微波炉、消毒碗柜、抽油烟机、煤气灶)(或同档次其他品牌) 美国爱适易垃圾处理器    3、厨房橱柜:德国艾诺(或同档次其他品牌)    4、室内石材:金世纪米黄、凡尔赛金、爵士白、帝王金、伯朗米黄、古典米黄、黑金花等多种高档大理石。    5、室内地板:高档实木复合地板    6、洁具:德国杜拉维特、乐伊(或同档次其它品牌)    7、龙头及淋浴花洒:德国汉斯格雅(或同档次其它品牌)    8、自然新风系统:德国丝吉利娅(或同档次其它品牌)    9、开关插座:德国吉徕(或同档次其它品牌)    10、可视对讲:韩国三星(7寸彩屏)    11、空调:日本大金变频中央空调    12、电梯:原装进口日本三菱电梯    13、配电箱:德国穆勒', '2009-06-20', '4.8元/月/平方米');
